import React, { Component } from 'react';
import Letter from './letters';
var alphabet="ABCDEFGHIJKLMNOPQRSTUVWXYZ";
class Row extends Component {
    render(i){
        return (
<div>
<Letter value={alphabet[i]}/>
<Letter value={'B'}/>
<Letter value={'C'}/>
</div>
        );
    };
};
export default Row;
